    "Character(s) used to separate fields; by default, the 'tab' character is used": "用于分隔字段的字符；默认情况下，使用制表符字符",
    "Method for quoting of strings: 'none' for no quoting, 'double' for quoting with doubling of embedded quotes": "字符串引号的方法：'none' 表示不使用引号，'double' 表示使用嵌入引号的加倍来进行引号",
