    "maximal number of iterations for the fitting step": "拟合步骤的最大迭代次数",
    "penalty term for the fitting of the position:If it differs too much from the initial one it can be penalized": "位置拟合的惩罚项：如果它与初始值相差太多，可以对其进行惩罚",
    "penalty term for the fitting of the left width:If the left width differs too much from the initial one during the fitting it can be penalized": "拟合左侧宽度的惩罚项：如果在拟合过程中左侧宽度与初始宽度相差太大，可以对其进行惩罚",
