    "[mzML output only] Assumes that the provided spectra represent data in SRM mode or targeted MS1 mode and converts them to chromatogram data": "[mzML 输出仅] 假设所提供的谱图代表 SRM 模式或目标化 MS1 模式的数据，并将其转换为色谱图数据",
