    "Within each of the two maps, the pairs considered for pose clustering must be separated by at least this fraction of the total elution time interval": "在两个映射中的每一个中，考虑姿态聚类的配对必须至少被总洗脱时间间隔的这个分数分隔开",
    "Maximum number of elements considered in each map (selected by intensity)": "每个映射中考虑的元素的最大数量（按强度选择）",
    "The scaling of the retention time interval is being hashed into buckets of this size during pose clustering": "在姿态聚类期间，保留时间间隔的缩放被散列到这个大小的桶中",
    "The shift at the lower (respectively, higher) end of the retention time interval is being hashed into buckets of this size during pose clustering": "在保留时间间隔的较低（或较高）端的偏移量在姿势聚类期间被散列到这个大小的桶中",
