    "COVERAGE_CAP; default=200": "覆盖度上限；默认值=200",
    "CLIP_OVERLAPPING_READS; default=true": "CLIP_OVERLAPPING_READS；默认值=true",
    "DEVIATIONS; This option is offered because insert size data typically includes enough anomalous values from chimeras and other artifacts to make the mean and SD grossly misleading regarding the real distribution. default=10.0": "偏差；提供此选项是因为插入大小数据通常包含来自嵌合体和其他工件的足够异常值，这使得均值和标准差对于真实分布极其误导。默认值=10.0",
    "HISTOGRAM_WIDTH; optional": "直方图宽度；可选",
