    "See \"Obtaining gene annotations in refFlat format\" below for help": "参见下面的“获取refFlat格式的基因注释”以获得帮助",
    "RIBOSOMAL_INTERVALS; If not specified no bases will be identified as being ribosomal. The list of intervals can be geberated from BED or Interval datasets using Galaxy BedToIntervalList tool": "核糖体区间；如果未指定，则不会有碱基被识别为核糖体。区间列表可以使用Galaxy的BedToIntervalList工具从BED或Interval数据集中生成。",
    "STRAND_SPECIFICITY; For unpaired reads, use FIRST_READ_TRANSCRIPTION_STRAND if the reads are expected to be on the transcription strand.": "链特异性；对于未配对的读取，如果读取预计在转录链上，请使用FIRST_READ_TRANSCRIPTION_STRAND。",
