    "COVERAGE_CAP; default=250": "覆盖度上限；默认=250",
    "If empty, upload or import a SAM or BAM dataset": "如果为空，请上传或导入一个SAM或BAM数据集",
    "PROBABILITY; specify 1 to keep all reads, 0.1 to keep 10% of the reads": "概率；指定1以保留所有读取，0.1以保留10%的读取",
    "RANDOM_SEED; default=1": "随机种子；默认=1",
    "MIN_IDENTICAL_BASES; In effect total_reads / 4^max_id_bases reads will be compared at a time, so lower numbers will produce more accurate results but consume exponentially more memory and CPU; default=5": "最小相同碱基数；实际上，每次将比较 total_reads / 4^max_id_bases 个读取，因此较小的数值将产生更准确的结果，但会消耗更多的内存和CPU；默认值=5",
    "MAX_DIFF_RATE; default=0.03": "最大差异率；默认值=0.03",
    "MIN_MEAN_QUALITY; Reads with lower average quality are filtered out and not considered in any calculations; default=20": "最小平均质量；平均质量低于此值的读段将被过滤掉，并且在任何计算中都不会考虑；默认值=20",
    "MAX_GROUP_RATIO; I.e. if the input contains 10m read pairs and MIN_IDENTICAL_BASES is set to 5, then the mean expected group size would be approximately 10 reads; default-500": "最大组比率；例如，如果输入包含1000万个读对，并且MIN_IDENTICAL_BASES设置为5，则预期的平均组大小大约为10个读；默认值-500",
    "Select between single end, paired end, and collections. See help below for full explanation of dataset types": "选择单端测序、双端测序和集合。详见下方帮助，以获取数据集类型的完整解释。",
    "FASTQ and FASTQ2; A collection of two datasets with forward and reverse reads. See help below on explanation of dataset collections": "FASTQ和FASTQ2；包含正向和反向读取的两个数据集的集合。有关数据集集合解释的帮助，请参见下面的说明。",
