    "ALLOW_INCOMPLETE_DICT_CONCORDANCE; By default, this tool requires a corresponding contig in the new reference for each read contig; default=False": "允许不完整字典一致性；默认情况下，这个工具要求新参考中每个读取的连续片段都有一个对应的连续片段；默认值为=False",
