    "--tag-parsed option": "--tag-parsed 选项",
    "--max-length option": "最大长度选项",
    "Note that in many cases, such as multisample VCFs, these won't be valid post-decomposition.  For biallelic loci in single-sample VCFs, they should be usable with caution. (--keep-info)": "请注意，在许多情况下，例如多样本VCFs，这些在分解后可能不是有效的。对于单样本VCFs中的双等位基因位点，它们应该谨慎使用。(--keep-info)",
    "Similar caution should be used for this as for --keep-info. (--keep-geno)": "对于这个选项，应该像对待--keep-info一样小心使用。(--keep-geno)",
    "The second dataset will be instersected with the first": "第二个数据集将与第一个数据集进行交集操作。",
    "This tools needs to access reference genomes sequence specified by this option.": "这个工具需要访问通过此选项指定的参考基因组序列。",
    "-i or -u": "-i 或 -u",
    "-v, --invert": "-v, --invert",
    "-w, --window-size": "-w, --窗口大小",
