    "such as -m, -t, -V, -M, and -T": "例如 -m、-t、-V、-M 和 -T",
    "Default is to require exact match between variants.": "默认情况下，要求变体之间完全匹配。",
    "ID and FILTER are special fields that pull the ID and FILTER columns from the VCF": "ID 和 FILTER 是特殊字段，它们从 VCF 文件中提取 ID 和 FILTER 列。",
    "In most cases, we will have a single annotation entry for each entry (variant) in the query VCF, in which case the self op is the best choice. However, it is possible that there will be multiple annotations from a single annotation file--in this case, the op determines how the many values are reduced. In nearly all cases, if you are annotating with a VCF, use self": "在大多数情况下，我们将为查询 VCF 中的每个条目（变体）有一个单独的注释条目，在这种情况下，选择 self 操作是最好的选择。然而，有可能来自单个注释文件会有多个注释——在这种情况下，op 确定如何将多个值进行简化。在几乎所有情况下，如果你正在使用 VCF 进行注释，请使用 self。",
    "(1-based) column number from which to pull the value for the op": "（基于1的）用于提取操作值的列号",
    "Field in the BAM to pull value from": "从BAM文件中提取值的字段",
    "Op to perform on the field. Note: DP2 field always will result in DP2 op": "对字段执行的操作。注意：DP2字段始终会导致DP2操作",
    "--key option": "--关键选项",
    "Annotation tag": "注释标签",
    "Determine which output file(s) to keep": "确定要保留的输出文件",
    "skip alignments with mapping quality smaller than INT [1]": "跳过映射质量小于INT的比对[1]",
    "skip bases with base quality smaller than INT [13]": "跳过碱基质量小于INT的碱基[13]",
    "initial counter value for nucleotides from ref [0]": "参考序列中核苷酸的初始计数值为[0]",
    "minimum coverage required for update [2]": "更新所需的最小覆盖度[2]",
    "in percent": "在百分比中",
    "in reads (per strand)": "在读取中（每个链）",
    "If checked, output positions present in the first file but missing from the other files": "如果选中，则输出在第一个文件中存在但在其他文件中缺失的位置",
    "In repetitive sequences, the same indel can be called at different positions. Consider records this far apart as matching (be it a SNP or an indel).": "在重复序列中，相同的插入/缺失（indel）可以在不同的位置被识别。考虑将相距这么远的记录视为匹配的（无论是单核苷酸多态性SNP还是插入/缺失indel）。",
    "Exclude sites containing indels from genotype comparison": "排除含有插入/缺失位点的基因型比较",
    "Set to 0|0": "设置为0|0",
    "Set to major allele": "设置为主等位基因",
    "List of trios, one per line": "三元组列表，每行一个",
    "Filter by sequence length. Will dump only reads longer or equal to this value.": "根据序列长度过滤。仅输出长度大于或等于该值的序列。",
    "This option will only be used when there are multiple reads per spot (for example paired-end).": "这个选项只有在每个位点有多个读取（例如配对末端）时才会使用。",
    "Will not be used if --split-3 is selected.": "如果选择了--split-3，则不会使用。",
    "Compression will greatly reduce the amount of space occupied by downloaded data. Downstream applications such as a short-read mappers will accept compressed data as input. Consider this example: an uncoimpressed 400 Mb fastq datasets compresses to 100 Mb or 80 Mb by gzip or bzip2, respectively.": "压缩将大大减少下载数据所占用的空间。下游应用，如短读映射器，将接受压缩数据作为输入。考虑这个例子：一个未压缩的400Mb fastq数据集通过gzip或bzip2分别压缩到100Mb或80Mb。",
    "Minimum spot id to be dumped.": "要导出的最小斑点ID。",
    "Maximum spot id to be dumped.": "最大斑点ID将被转储。",
    "Split spots into individual reads.": "将斑点分割成独立的读取。",
    "For SRA of noisy long-reads put SEQUENCE": "对于嘈杂的长读序列读取档案（SRA），输入序列（SEQUENCE）。",
    "In vast majority of cases you want to download data in bam format. It is more compact and is accepted by all downstream tools.": "在绝大多数情况下，您希望以bam格式下载数据。它更加紧凑，并且被所有下游工具接受。",
    "Must start with SRR, e.g. SRR925743": "必须以SRR开头，例如SRR925743",
    "window_size should be less than the sequence length, and less than 8 for Karplus-Schulz method": "窗口大小应小于序列长度，并且对于Karplus-Schulz方法应小于8",
    "Select database source. cRAP acts as a database for common MS contaminants. UniProtKB is a cross species collection of functional protein databases": "选择数据库来源。cRAP 作为常见质谱污染的数据库。UniProtKB 是一个跨物种的功能性蛋白质数据库集合。",
    "select species for protein database": "选择蛋白质数据库的物种",
    "Specify a NCBI taxon id to override species selection": "指定一个NCBI分类ID以覆盖物种选择",
    "UniProtKB/TrEMBL (unreviewed)is a large, automatically annotated database- may contain redundant sequences, but there is a higher chance peptides will be identified. UniProtKB/Swiss-Prot (reviewed) is a smaller, manually annotated database- less of a chance peptides will be identified but less sequence redundancy": "UniProtKB/TrEMBL（未经审核）是一个大型的、自动注释的数据库，可能包含冗余序列，但肽段被鉴定的几率更高。UniProtKB/Swiss-Prot（经过审核）是一个较小的、手动注释的数据库，肽段被鉴定的几率较小，但序列冗余较少。",
    "several different forms of a given protein are incorporated into database": "将给定蛋白质的几种不同形式纳入数据库",
    "Newline/Comma separated list of IDs": "用换行符或逗号分隔的ID列表",
    "Region to subset accession. Start and end position separated by ':', '..', or '.'. Only for single accession": "区域以子集访问号。起始和结束位置由 ':', '..', 或 '.' 分隔。仅适用于单个访问号",
    "Enter one or more IDs (separated by commas) from http://www.uniprot.org/proteomes/": "输入一个或多个来自 http://www.uniprot.org/proteomes/ 的ID（用逗号分隔）",
    "Genus species format, eg : Canis lupus": "属种格式，例如：Canis lupus",
    "Any combination of gbif, bison, inat, ebird, antweb, ala, idigbio, obis, ecoengine and/or vertnet": "任何gbif、bison、inat、ebird、antweb、ala、idigbio、obis、ecoengine和/或vertnet的组合",
    "This is passed across all sources. If you have an empty output you should try with a records value smaller.": "这会在所有来源中传递。如果你的输出为空，你应该尝试使用一个更小的记录值。",
