    "If this option is set to Yes, only the first occurrence of each input Gene ID will be kept. Default: No": "如果将此选项设置为“是”，则仅保留每个输入基因ID的第一个出现。默认值：否。",
    "If this option is set to Yes, the Rscript used to annotate the IDs will be provided as a text file in the output. Default: No": "如果将此选项设置为Yes，用于注释ID的Rscript将作为文本文件提供在输出中。默认值：No",
    "FASTA file with contig(s)": "带有连续序列的FASTA文件",
    "MASH sketch of the reference plasmids database": "MASH 草图的参考质粒数据库",
