    "A string vector that defines a pre-processing of the predictor data. Enter values as comma-separated string. Current possibilities are 'BoxCox', 'YeoJohnson', 'expoTrans', 'center', 'scale', 'range', 'knnImpute', 'bagImpute', 'medianImpute', 'pca', 'ica' and 'spatialSign'. The default is 'center' and 'scale'.": "一个字符串向量，用于定义预测器数据的预处理。输入值时以逗号分隔字符串。当前可能性包括'BoxCox'、'YeoJohnson'、'expoTrans'、'center'、'scale'、'range'、'knnImpute'、'bagImpute'、'medianImpute'、'pca'、'ica'和'spatialSign'。默认值为'center'和'scale'。",
    "If TRUE, training data is returned within scPred object. Default: False": "如果为真，训练数据将包含在scPred对象中。默认值：假",
