    "The maximum number of representative cells per cell type to be included in the model training. Decreasing this number increases speed, but may hurt performance of the model.": "模型训练中每种细胞类型包含的代表性细胞的最大数量。降低此数量可以提高速度，但可能会影响模型的性能。",
    "CDS object with predicted labels": "带预测标签的CDS对象",
    "Classifier object in rdata format": "R数据格式中的分类器对象",
    "Path to the object of class garnett_classifier, which is either trained via garnett_train_classifier.R or obtained elsewhere": "类garnett_classifier的对象的路径，该对象是通过garnett_train_classifier.R训练的，或者从其他地方获得的",
    "In case a hierarchical marker tree was used to train the classifier, specify which node features should be shown. Default is 'root'. For other nodes, use the corresponding parent cell type name": "如果使用层次化标记树来训练分类器，请指定应显示哪些节点特征。默认为'root'。对于其他节点，请使用相应的父细胞类型名称。",
    "Boolean that indicates whether the gene IDs should be converted into SYMBOL notation": "一个布尔值，指示是否将基因ID转换为SYMBOL表示法",
    "Boolean, tells Garnett whether to create a second set of assignments that expands classifications to cells in the same cluster": "布尔值，告诉Garnett是否创建第二组分配，将分类扩展到同一簇中的单元",
    "Numeric value greater than 1. This is the minimum odds ratio between the probability of the most likely cell type to the second most likely cell type to allow assignment. Default is 1.5. Higher values are more conservative.": "数值大于1。这是最可能的细胞类型与第二可能的细胞类型之间允许分配的概率的最小比值。默认值为1.5。更高的值更保守。",
    "Aggregated prediction tables from multiple tools": "聚合多个工具的预测表格",
