    "string like 'TYP:csv,TID:1,LEN:3,SCO:6,UNC:0' where valid file Types are csv/tsv/ssv, and the rest of fields indicate the number of column used (starting in 1) for the TaxIDs assigned,the LENgth of the read, the SCOre given to the assignment": "字符串格式为 'TYP:csv,TID:1,LEN:3,SCO:6,UNC:0'，其中有效的文件类型为 csv/tsv/ssv，其余字段表示用于分配 TaxIDs 的列数（从 1 开始），读取的长度，分配的得分。",
