    "More features can be renamed with advanced mode": "更多功能可以在高级模式下重命名",
    "The mapping file must be tabular format file with two tab-separated columns. The first column must contain the value you want to modify and the second contain the new value": "映射文件必须是具有两列的表格格式文件，第一列必须包含您想要修改的值，第二列包含新值。",
