    "File needs to be generated with MetaPhlAn versions >3.0": "需要生成的文件必须使用 MetaPhlAn 版本大于 3.0",
    "Markers are also extracted for subclades": "标记也用于提取亚群",
    "It is used for normalizing the length-normalized counts with the microbiota size as well. No normalization applied if the value is not specified": "它用于使用微生物群大小对长度标准化计数进行标准化。如果未指定值，则不应用标准化。",
