    "All values above this value are given the same color.": "所有高于这个值的值都被赋予相同的颜色。",
    "Produces a 2-column grid plot, showing known functional information about the Genus-level OTUs next to the heatmap. When using this feature, make sure that either tax_aggregate or tax_add is set to Genus and that Genus is the lowest level in either.": "生成一个两列的网格图，显示关于属级操作分类单元（OTUs）的已知功能信息，并将其显示在热图旁边。使用此功能时，请确保将tax_aggregate或tax_add设置为属（Genus），并且属是两者中最低的分类级别。",
    "See help": "查看帮助",
    "By default ampvis2 expects a column named ASV or OTU containing the ASV or OTU identifiers. By checking this a column with an empty header will be used (as produced by dada2).": "ampvis2 默认期望有一个名为 ASV 或 OTU 的列，其中包含 ASV 或 OTU 标识符。勾选此选项将使用一个带有空标题的列（由 dada2 生成）。",
    "By checking this the identifiers will be renamed to ASV1, ASV2, etc and the sequences will be stored in the ampvis2 object.": "勾选此选项后，标识符将被重命名为 ASV1、ASV2 等，序列将存储在 ampvis2 对象中。",
    "Needed by most downstream tools. Select if the inputs contain taxonomic / metadata information.": "大多数下游工具都需要。如果输入包含分类学/元数据信息，请选择。",
    "The full DNA sequences will then be used as the new names in the output.": "完整的DNA序列将用作输出中的新名称。",
    "If the read counts are integers, any decimals present after merging will be rounded either up or down. Make sure this makes sense if the read counts have been normalised, as it may result in 0's, 1's, and 2's everywhere.": "如果读取计数是整数，合并后出现的任何小数将向上或向下四舍五入。如果读取计数已经过标准化处理，请确保这在逻辑上是有意义的，因为这可能导致到处都是0、1和2。",
    "OTU's that have not been assigned at the chosen level will be removed with a message.": "未被分配到所选水平的OTU将被移除，并伴随一条消息。",
    "Variable needs to be categorical/discrete": "变量需要是分类/离散的",
    "Only relevant if for group_by a value is selected": "仅在选择了group_by的值时才相关",
    "Remove low abundant OTU's across all samples below this threshold in percent. Setting this to 0 may drastically increase computation time.": "移除所有样本中低于此百分比阈值的低丰度OTU。将此设置为0可能会大幅增加计算时间。",
    "Note that PCoA is not performed by the vegan package, but the pcoa function from the APE package.": "请注意，主坐标分析（PCoA）不是由vegan包执行的，而是由APE包中的pcoa函数执行的。",
    "Based on the used arguments. The caption includes a description of how the result has been generated as well as references for the methods used.": "根据所使用的参数，标题包含了对结果生成方式的描述以及所使用的方法的引用。",
    "Split by the variable defined by sample_color_by": "根据由 sample_color_by 定义的变量进行拆分",
    "Ordered by the sum of the numerical values of the x,y coordinates. Only makes sense with PCA/RDA).": "按 x,y 坐标数值之和排序。仅与 PCA/RDA 有意义。",
    "The lengths of the arrows are scaled by significance.": "箭头的长度按显著性进行了缩放。",
    "For displaying the fitting results": "用于展示拟合结果",
    "To prevent cluttering of the plot": "为了预防图表混乱",
    "0: invisible, 1: opaque.": "0: 透明，1: 不透明。",
    "plot of variances against the number of the principal component": "方差与主成分数量的图表",
    "Often most variation is observed among the most abundant OTU's, log10-transforming the x-axis will highlight this better.": "通常在丰度最高的操作分类单元（OTU）之间观察到的变异最大，对x轴进行log10变换可以更好地突出这一点。",
    "Lower is prettier but takes more time to generate.": "低分辨率的看起来更漂亮，但生成时间更长。",
    "Only relevant if for facet_by a value is selected": "仅在为facet_by选择一个值时才相关",
    "Per sample. Samples below this value will be removed initially": "每个样本。低于这个值的样本最初将被移除",
    "This is done initially, but after filtering based on the minreads value, if set.": "这是最初完成的，但在基于minreads值进行过滤后，如果设置了该值。",
    "Generated with ampvis2: load": "使用ampvis2生成：加载",
    "Selected taxa will be removed instead of being the only ones kept in the data.": "选定的分类群将被移除，而不是作为数据中唯一保留的分类群。",
    "Must be directly compatible with as_date and preferably of the form yyyy-mm-dd or %Y-%m-%d": "必须与as_date直接兼容，最好采用yyyy-mm-dd或%Y-%m-%d的形式",
    "OTU's below this abundance are excluded from the analysis": "低于这个丰度的OTU被排除在分析之外",
