    "Require at least this dashing-derived ANI for preclustering and to avoid FastANI on distant lineages within preclusters.": "要求至少使用这个基于dashing的ANI进行预聚类，并避免在预聚类内的不同谱系上使用FastANI。",
    "It is used both for filtering and to rank genomes during clustering": "它既用于过滤，也用于在聚类过程中对基因组进行排序",
    "Genomes with lower completeness percentage will be ignored": "基因组完整性百分比较低的将被忽略",
