    "Produced by the dada2 removeBimeraDenovo tool": "由dada2的removeBimeraDenovo工具生成",
    "Produced by the dada2 assignTaxonomyAndAddSpecies tool": "由dada2 assignTaxonomyAndAddSpecies工具生成",
    "Rows are sample names, Columns are properties": "行是样本名称，列是属性",
    "Zero value disables": "零值禁用",
