    "Sorted Bam file": "排序的Bam文件",
    "Instead of using the fasta ID (space in header before space), use the full header. Needed for some mapping tools (including bbMap)": "而不是使用fasta ID（标题前面的空格），使用完整的标题。这对于某些映射工具（包括bbMap）是必需的。",
    " Minimum percent identity of read pairs to consensus to use the reads. Must be >, not >=": "用于共识的读对的最小百分比一致性。必须大于，而不是大于等于",
