    "Multiplier to determine maximum insert size between two reads - default is to use 3x median insert size. Must be >, not >=": "乘数用于确定两个读取之间的最大插入片段大小，默认情况下是使用3倍的中位数插入片段大小。必须大于，而不是大于等于。",
    "Minimum insert size between two reads - default is 50 bp. If two reads are 50bp each and overlap completely, their insert will be 50. Must be >, not >=": "两个读取之间的最小插入片段大小 - 默认为50个碱基对。如果两个读取各自为50个碱基对，并且完全重叠，则它们的插入片段大小将为50。必须大于，而不是大于等于。",
    "For example long reads or merged reads. This can be a .fastq file or text file with list of read names (will assume file is compressed if ends in .gz": "例如长读段或合并读段。这可以是一个.fastq文件或包含读段名称列表的文本文件（如果文件以.gz结尾，则假定文件是压缩的）。",
    " Minimum coverage to call a variant": "最小覆盖度以调用一个变体",
    "Minimum SNP frequency to confirm a SNV (both this AND the FDR snp count cutoff must be true to call a SNP).": "确认SNV（单核苷酸变异）的最小SNP频率（必须同时满足这个条件和FDR snp计数截止值才能调用一个SNP）。",
    "SNP false discovery rate- based on simulation data with a 0.1 percent error rate (Q30)": "SNP假发现率 - 基于0.1%错误率（Q30）的模拟数据",
    "EXPERIMENTAL; the name of the gene must be in the gene qualifier": "实验性的；基因名称必须在基因限定符中",
    "This can be a file with each line listing a scaffold and a bin name, tab-seperated. This can also be a space-seperated list of .fasta files, with one genome per .fasta file. If nothing is provided, all scaffolds will be treated as belonging to the same genome": "这可以是一个文件，每行列出一个scaffold和一个bin名称，用制表符分隔。这也可以是一个由空格分隔的.fasta文件列表，每个.fasta文件包含一个基因组。如果未提供任何内容，所有scaffold将被视为属于同一个基因组。",
    "Dont perform analysis on an mm level; saves RAM and time; impacts plots and raw_data": "不要在毫米级别上进行分析；节省内存和时间；影响图表和原始数据",
    "Set a number of parameters to values appropriate for mapping to a large fasta file.": "设置一些参数，使其适用于映射到大型fasta文件的值。",
    "Minimum number of reads mapping to a scaffold to proceed with profiling it": "用于构建概要文件的映射到支架的最小读取数",
    "Minimum number of reads mapping to a genome to proceed with profiling it. MUST profile .stb if this is set": "最小映射到基因组的读数数量以进行分析。如果设置了这个参数，则必须对.stb文件进行分析。",
