    "In heatmap, plot top N features with significant associations": "在热图中，绘制与显著关联的前N个特征",
    "Zero value uses all tables": "零值使用所有表格",
    "MALT reports up to this many best scoring matches for each hit reference sequence": "MALT 报告每个命中的参考序列最多这么多得分最高的匹配",
    "For each read, matches are used for taxonomic placement whose bit disjointScore is within this percentage of the best disjointScore": "对于每个读取，使用匹配项进行分类定位，其位不相交分数是最佳不相交分数的这个百分比内。",
