    "Overrides the above parameter": "覆盖上述参数",
    "This read file should be the one used by DIAMOND or MALT to generate the SAM file below": "这个读取文件应该是 DIAMOND 或 MALT 用来生成下面 SAM 文件的那个文件",
    "Use 0 if read and mate have the same name": "如果读取和配对具有相同的名称，则使用0",
    "Set to true for NCBI-nr downloaded Sep 2016 or later": "设置为 true 以适用于 2016 年 9 月或之后下载的 NCBI-nr",
    "Specify a space-separated list of tags (e.g., 'gb|' 'ref|')": "指定一个以空格分隔的标签列表（例如，'gb|' 'ref|'）",
