    "Table where each row correspond to a contig, and each column correspond to a sample. The values are the average coverage for this contig in that sample": "表格中每一行对应一个连续序列，每一列对应一个样本。这些值是该连续序列在该样本中的平均覆盖度。",
    "It is named the composition file since it is used to calculate the kmer composition (the genomic signature) of each contig.": "它被称为组成文件，因为它用于计算每个连续序列的kmer组成（基因组特征）。",
    "Contigs shorter than this value will not be included": "比这个值短的连续序列将不会被包含",
