    "The resulting window reaches from mass[currentIndex-halfWindowSize] to mass[currentIndex+halfWindowSize] (window size is 2*halfWindowSize+1). The best size differs depending on the selected smoothing method.": "生成的窗口从 mass[currentIndex-halfWindowSize] 到 mass[currentIndex+halfWindowSize]（窗口大小为 2*halfWindowSize+1）。最佳大小取决于所选的平滑方法。",
    "Spectra with same annotation are averaged before peak detection, no imzML output": "具有相同注释的光谱在峰值检测之前进行平均，不输出imzML",
    "Minimal correlation between the peak pattern generated by the model and the experimental peaks in the MassPeaks object to be recognized as isotopic pattern.": "模型生成的峰模式与MassPeaks对象中的实验峰之间的最小相关性，被认为是同位素模式。",
    "Maximal relative deviation of a peak position (m/z) to be considered as identical: abs(((mass[i]+distance)-mass[i+1])/mass[i]) smaller than 'tolerance'. For 100ppm use 0.0001": "峰位（m/z）的最大相对偏差被认为是相同的：abs(((mass[i]+distance)-mass[i+1])/mass[i]) 小于 'tolerance'。对于100ppm使用0.0001",
    "Distance between two consecutive peaks in an isotopic pattern. 1.00235 is average distance for polypeptides. Multiple values can be used to find multiple charged pattern e.g. 1, 0.5 ,0.33": "在同位素模式中两个连续峰之间的距离。1.00235 是多肽的平均距离。可以使用多个值来查找多重带电模式，例如 1, 0.5, 0.33",
    "Size (length) of isotopic pattern, longer patterns are prefered over shorter ones, min size is 2, a range can be used.": "同位素模式的大小（长度），较长的模式比短的模式更受青睐，最小尺寸为2，可以使用范围。",
    "Maximal relative deviation of a peak position (m/z) to be considered as identical. For 50ppm use 0.00005 or 5e-5": "峰位（m/z）的最大相对偏差，以被视为相同。对于50ppm，使用0.00005或5e-5",
    "If given, samples will be aligned to reference, use internal calibrants to perform m/z calibration": "如果提供，样本将与参考序列对齐，使用内部校准物进行 m/z 校准",
    "Removal of all peaks which occur in less than minFrequency spectra to generate the reference m/z": "移除在少于minFrequency个谱图中出现的峰，以生成参考m/z",
    "Internal binning is omitted to avoid interaction between spectra": "内部分箱被省略以避免光谱之间的相互作用",
    "After the alignment the peak positions (mass) are very similar but not identical. The binning is needed to make similar peak mass values identical.": "对齐后，峰位（质量）非常相似但不完全相同。需要进行分箱，以使相似的峰质量值相同。",
    "strict - creates bins never containing two or more peaks of the same sample. relaxed - allows multiple peaks of the same sample in one bin.": "严格 - 创建的bin永远不包含同一样本的两个或更多峰。宽松 - 允许一个bin中存在同一样本的多个峰。",
    "By default a single group is assumed and filtering will be done based on all pixels. To filter groups of spectra, an annotation annotation file has to be specified above": "默认情况下，假设为单一组，并将基于所有像素进行过滤。要过滤光谱组，必须在上面指定注释注释文件。",
    "Yes means that peaks that survive the filtering in one annotation group are also kept in other groups regardless if the filtering criteria are met in these groups": "是的，这意味着在一个注释组中通过过滤的峰值也会保留在其他组中，而不管这些组中是否满足过滤标准。",
    "minFrequency: Removal of all peaks which occur in less than minFrequency spectra (relative treshold). minNumber: Removal of all peaks which ocur in lass than minNumber spectra (absolute threshold). If both are set the higher value from relative and absolute threshold is taken.": "最小频率：移除在少于最小频率（相对阈值）的光谱中出现的峰。最小数量：移除在少于最小数量（绝对阈值）的光谱中出现的峰。如果两者都设置，则采用相对和绝对阈值中的较高值。",
    "( --tric_chromprob / --no-tric_chromprob)": "( --tric_chromprob / --no-tric_chromprob)",
    "Ranges from 0 (min, fast) to 3 (max, slow)": "范围从0（最小，快速）到3（最大，慢速）",
    "Max number of overlapping features in any mz window. Keep as low as necessary for speed": "在任何mz窗口中重叠特征的最大数量。为了速度，尽可能保持低值。",
    "Peptides persisting for longer than this value are excluded": "肽段如果持续时间超过这个值则被排除",
