    "Peptides in adjacent scans must differ by less than this value to be called the same.": "相邻扫描中的肽段必须相差小于这个值才能被认为是相同的。",
    "tabular file containing peptides for the alignment, e.g. iRTs or ciRTs": "包含用于比对的肽段的表格文件，例如 iRTs 或 ciRTs。",
    "This file needs to be in OSW format, an SQLite variant.": "这个文件需要是OSW格式的，SQLite的一个变种。",
    "This file needs to be in OSW format.": "这个文件需要是OSW格式的。",
    "MetaMorpheus,Morpheus,PeptideShaker PSM Report,MaxQuant": "MetaMorpheus、Morpheus、PeptideShaker PSM 报告、MaxQuant",
