    "Reporter label maximum peak intensity threshold to consider the tag for quantitation. Default is 0. It depends on signal to noise ratio (S/N)": "报告标签最大峰值强度阈值以考虑标签进行定量。默认值为0。这取决于信号与噪声比（S/N）",
    "A proteoform defines a specific state of a protein. It is composed by the protein UniProt accession, isoform and set of post translational modifications. The input file contains one line for each proteoform. Each PTM is specified using a modification identifier and a site, separated by ':'(semicolon). For example: '00046:133'. The identifier is a 5 digit id from the PSI-MOD Protein Modification Onthology [6].": "一个蛋白质形态定义了一个特定状态的蛋白质。它由蛋白质UniProt访问号、异构体和一组翻译后修饰组成。输入文件包含每个蛋白质形态的一行。每个PTM（翻译后修饰）使用修饰标识符和位点指定，由冒号 ':'（分号）分隔。例如：'00046:133'。该标识符是PSI-MOD蛋白质修饰本体[6]中的一个5位数字id。",
    "Plus minus positions for the same PTM site": "同一PTM位点的正负位置",
