    "File with a one Ensembl identifier [5] in each line.": "每行包含一个Ensembl标识符的文件。",
    "The input follows the Variant Call Format Specification[2] v4.3. It also allows the possibility to specify only the first 4 columns in the data section of the file: CHROM, POS, ID, REF.": "输入遵循变体调用格式规范[2] v4.3。它还允许在文件的数据部分中仅指定前4列：CHROM（染色体）、POS（位置）、ID（标识符）、REF（参考序列）。",
    "Genetic variants can also be represented using the chromosome and the base pair numbers. The input should be sorted by chromosome number and then by base pair.": "遗传变异也可以用染色体和碱基对数来表示。输入应先按染色体编号排序，然后按碱基对排序。",
    "The file contains one rsid identifier as defined in dbSNP[1] on each row. The list must be ordered by chromosome and base pair (bp). The list must not have duplicates. All rsids must appear in the human assembly GRCh37.p13.": "该文件每行包含一个在dbSNP[1]中定义的rsid标识符。列表必须按染色体和碱基对（bp）排序。列表中不能有重复项。所有的rsid都必须出现在人类基因组组装GRCh37.p13中。",
    "File with a one peptide sequence in each line.": "每行包含一个肽段序列的文件。",
