    "Integer number margin error for sites of PTMs. Only for modified peptides.": "整数数量边距错误，针对PTMs（翻译后修饰）位点。仅针对修饰肽段。",
    "Generates a zipped file with connection graphs as an additional output when executing the pathway search and analysis. The graph can use genes, proteins or proteoforms as vertices.": "在执行通路搜索和分析时，生成一个包含连接图的压缩文件作为额外输出。该图可以使用基因、蛋白质或蛋白质异构体作为顶点。",
