    "For postprocessing with PeptideShaker the sequences must have UniProt style headers and contain decoy sequences (see help).": "对于使用PeptideShaker进行后处理，序列必须具有UniProt风格的标题，并且包含诱饵序列（见帮助）。",
    "Select appropriate MGF/MZML dataset(s) from history. Remember to choose only .mzML files when using MetaMorpheus.": "从历史记录中选择适当的MGF/MZML数据集。使用MetaMorpheus时，请确保只选择.mzML文件。",
