    "Creates a standard MGF file.": "创建一个标准的MGF文件。",
    "Specify a mass cutoff to be applied when generating MGF files. May be of use if removal of reporter ions is desired prior to searching of MS2 spectra.": "指定在生成MGF文件时应用的质量截止值。如果希望在搜索MS2谱图之前去除报告离子，可能会有用。",
    "Refine precursor charge and monoisotopic mass assignments. Highly recommended if monoisotopic precursor selection was turned off in the instrument method (or peptide match on a QE instrument).": "精炼前体电荷和单同位素质量分配。如果仪器方法中关闭了单同位素前体选择（或在QE仪器上进行了肽段匹配），强烈推荐使用此功能。",
