    "Number of data points, the resulting window reaches from mass[currentIndex-halfWindowSize] to mass[currentIndex+halfWindowSize] (window size is 2*halfWindowSize+1).": "数据点的数量，结果窗口从 mass[currentIndex-halfWindowSize] 延伸到 mass[currentIndex+halfWindowSize]（窗口大小为 2*halfWindowSize+1）。",
