    "Number of data points, the resulting window reaches from mass[currentIndex-halfWindowSize] to mass[currentIndex+halfWindowSize] (window size is 2*halfWindowSize+1). The best size differs depending on the selected smoothing method.": "数据点的数量，所得窗口从 mass[currentIndex-halfWindowSize] 到 mass[currentIndex+halfWindowSize]（窗口大小为 2*halfWindowSize+1）。最佳大小取决于所选的平滑方法。",
