    "(-use_relative)": "（使用相对）",
    "(-window_relative) e.g. the window is calculated as [rt - rt*X, rt + rt*X]": "（窗口相对）例如，窗口计算为 [rt - rt*X, rt + rt*X]",
    "(-window_absolute) e.g. the window is calculated as [rt - X, rt + X]": "（窗口绝对值）例如，窗口被计算为 [rt - X, rt + X]",
    "(-mz_tol) Unit of this is defined in 'mz_tol_unit'": "（-mz_tol）此参数的单位在'mz_tol_unit'中定义",
    "(-mz_tol_unit)": "(-mz_tol_unit)",
    "(-rt_tol) Two inclusion/exclusion windows are merged when they (almost) overlap in RT and are close in m/z by this tolerance (see 'mz_tol'). Unit of this param is [seconds]": "(-rt_tol) 当两个包含/排除窗口在保留时间（RT）上（几乎）重叠，并且通过这个容差在m/z上接近时，它们会被合并（参见'mz_tol'）。此参数的单位是[秒]",
    "(-ms2_spectra_per_rt_bin)": "（-ms2_spectra_per_rt_bin）",
    "(-exclude_overlapping_peaks)": "（排除重叠峰）",
    "(-use_dynamic_exclusion)": "（使用动态排除）",
    "(-exclusion_time)": "（排除时间）",
    "(-max_list_size)": "（最大列表大小）",
    "(-min_rt)": "（最小保留时间）",
    "(-max_rt)": "（最大运行时间）",
    "(-rt_step_size)": "（-rt_step_size）",
