    "(-min_peptide_probability)": "（最小肽概率）",
    "(-no_intensity_normalization) This is done for each feature separately, so that the feature's maximal intensity in a spectrum is set to 1": "（不进行强度标准化）这是对每个特征单独进行的，以便将特征在谱图中的最大强度设置为1。",
    "(-max_number_precursors_per_feature)": "（最大前体数每特征）",
    "(-signal_to_noise)": "（信噪比）",
    "(-ms_levels) Other scans are copied to the output without changes": "(-ms_levels) 其他扫描被复制到输出中，不做任何改变",
    "(-report_FWHM)": "-报告_FWHM",
    "(-win_len)": "-窗口长度",
    "(-bin_count)": "(-二进制计数)",
    "(-min_required_elements)": "（最小必需元素数）",
    "(-write_log_messages)": "（写入日志消息）",
    "(-spacing_difference_gap) 'min_spacing' is the smaller of the two spacings from the peak apex to its two neighboring points. '0' to disable the constraint. Not applicable to chromatograms": "（间距差异间隔）'min_spacing' 是从峰顶到其两个相邻点的两个间距中较小的一个。'0' 用于禁用该约束。不适用于色谱图",
    "(-spacing_difference) If this difference is exceeded a missing point is assumed (see parameter 'missing'). A higher value implies a less stringent peak definition, since individual signals within the peak are allowed to be further apart. '0' to disable the constraint. Not applicable to chromatograms": "（间距差异）如果这个差异超过设定值，就会假定有一个缺失点（参见参数'missing'）。较高的值意味着峰值定义不那么严格，因为峰内个别信号被允许相距更远。'0'用于禁用该约束。不适用于色谱图。",
    "(-missing) A missing data point occurs if the spacing between two subsequent data points exceeds 'spacing_difference * min_spacing'. 'min_spacing' is the smaller of the two spacings from the peak apex to its two neighboring points. Not applicable to chromatograms": "（-missing）如果两个连续数据点之间的间距超过“spacing_difference * min_spacing”，则会发生缺失数据点。“min_spacing”是从峰顶到其两个相邻点的两个间距中较小的一个。不适用于色谱图。",
    "(-max_intensity) By default, it will be calculated automatically (see auto_mode). Only provide this parameter if you know what you are doing (and change 'auto_mode' to '-1')! All intensities EQUAL/ABOVE 'max_intensity' will be added to the LAST histogram bin. If you choose 'max_intensity' too small, the noise estimate might be too small as well.  If chosen too big, the bins become quite large (which you could counter by increasing 'bin_count', which increases runtime). In general, the Median-S/N estimator is more robust to a manual max_intensity than the MeanIterative-S/N": "（-最大强度）默认情况下，它将自动计算（见auto_mode）。只有在你知道自己在做什么时才提供此参数（并将'auto_mode'更改为'-1'）！所有等于/高于'max_intensity'的强度将被添加到直方图的最后一个bin中。如果你选择的'max_intensity'太小，噪声估计可能也太小。如果选择得太大，bin会变得相当大（你可以通过增加'bin_count'来抵消这种情况，这会增加运行时间）。一般来说，中值信噪比估计器比平均迭代信噪比估计器对手动max_intensity更为稳健。",
    "(-auto_max_stdev_factor)": "(-自动最大标准差因子)",
    "(-auto_max_percentile)": "(-自动最大百分位数)",
    "(-auto_mode)": "(-自动模式)",
