    "(-target_nucleotides) e.g. A=C10H14N5O7P, ..., U=C10H14N5O7P, X=C9H13N2O8PS  where X represents e.g. tU  <br> or e.g. Y=C10H14N5O7PS where Y represents tG": "（目标核苷酸）例如 A=C10H14N5O7P, ..., U=C10H14N5O7P, X=C9H13N2O8PS 其中 X 代表例如 tU 或者例如 Y=C10H14N5O7PS 其中 Y 代表 tG",
