    "(-Z) Only available if -X is used": "(-Z) 仅在使用了-X参数时可用",
    "(-p) Set by cross validation if not specified": "（-p）如果未指定，则通过交叉验证设置",
    "(-n) Set by cross validation if not specified": "（-n）如果未指定，则通过交叉验证设置",
